import React, { Component } from 'react'
import Talk from '../Talk/Talk'
import { connect } from 'react-redux';

 class ShowAllTalks extends Component {
  render() {
    return (
      <div>
        Welcome {this.props.user} !
        <br />
        <Talk />
      </div>
    )
  }
}

export default connect(null, null)(ShowAllTalks)
